import React,{Component} from 'react';
export class Home extends Component{

    render(){
        return(

  <div className="container-fluid">
      <div className="row">
          <h1 className="text-primary">Student Management Web Application</h1>
        <p>Welcome to student management web application developed by using</p><br></br>
        <ul>
            <li>Django Rest API Framework</li>
            <li>Django Web Framework</li>
            <li>React JS</li>
            <li>Redux</li>
            <li>MySQL Database</li>
        </ul>
          



      </div>
  </div>


        )
    }
}
